import React from 'react'
import { Row,
         Form, 
         Input, 
         Button, 
         Checkbox, 
         Col, Card, 
         DatePicker, 
         InputNumber 
         
} from 'antd';

const Upload = () => {
    const onFinish = (values) => {
        console.log('Success:', values);
    };
    
    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    return (
        
        <Row>
            <Col>
                <Card title="สำหรับรับเข้า-ส่งออกข้อมูลเอกสาร">
                    <Form
                        name="basic"
                        labelCol={{
                            span: 8,
                        }}
                        wrapperCol={{
                            span: 16,
                        }}
                        initialValues={{
                            remember: true,
                        }}
                        onFinish={onFinish}
                        onFinishFailed={onFinishFailed}
                        autoComplete="off"
                        >
                        <Form.Item
                            label="วันที่"
                            name="ulDate"
                            rules={[
                            {
                                required: true,
                                message: 'กรุณากรอกวันที่!',
                            },
                            ]}
                        >
                            <DatePicker />
                        </Form.Item>

                        <Form.Item
                            label="เลขรับ"
                            name="UlInID"
                            rules={[
                            {
                                required: true,
                            },
                            ]}
                        >
                            <Input />
                        </Form.Item>


                        <Form.Item
                            label="ที่"
                            name="UlLocate"
                            rules={[
                            {
                                required: true,
                                message: 'กรุณากรอกที่',
                            },
                            ]}
                        >
                            <Input />
                        </Form.Item>


                        <Form.Item
                            label="ลงวันที่"
                            name="UlDateGen"
                            rules={[
                            {
                                required: true,
                            },
                            ]}
                        >
                            <DatePicker />
                        </Form.Item>

                        <Form.Item
                            label="จาก"
                            name="UlFrom"
                            rules={[
                            {
                                required: true,
                            },
                            ]}
                        >
                            <Input />
                        </Form.Item>
                        <Form.Item
                            label="ถึง"
                            name="UlTo"
                            rules={[
                            {
                                required: true,
                            },
                            ]}
                        >
                            <Input />
                        </Form.Item>


                        <Form.Item
                            label="เรื่อง"
                            name="UlTitle"
                            rules={[
                            {
                                required: true,
                                message: 'กรุณากรอกชื่อเรื่อง',
                            },
                            ]}
                        >
                            <Input />
                        </Form.Item>

                        

                        <Form.Item
                            wrapperCol={{
                            offset: 8,
                            span: 16,
                            }}
                        >
                            <Button type="primary" htmlType="submit">
                            Submit
                            </Button>
                        </Form.Item>
                    </Form>
                </Card>
            
            </Col>



        </Row>
    )
}

export default Upload
